import {Link} from 'react-router-dom';

export class UserNavBar extends Component {
    render(){
        return (
            <Fragment>
                <nav className="navbar navbar-expand-lg navbar-light bg-light">
                    <ul>
                        <li>
                            <Link to = '/'> main page </Link>
                        </li>
                        <li></li>
                        <li></li>
                        <li></li>
                        <li></li>
                    </ul>
                </nav>
            </Fragment>
        )
    }
}


export default UserNavBar;
